import React from 'react';

export default function Navbar(){
    return(
        <div>
            <nav class="navbar navbar-success bg-dark">
                <div class="container container-fluid">
                    <a class="navbar-brand">Tugas Dua</a>
                </div>
            </nav>
            <div class="pb-3"></div>
        </div>
    )
}
